DROP TABLE IF EXISTS `languagedictionary`;

CREATE TABLE `languagedictionary` (
  `LanguageDictionaryId` int(11) DEFAULT '0',
  `Key` varchar(100) COLLATE utf8_bin DEFAULT NULL,
  `code` varchar(100) COLLATE utf8_bin NOT NULL,
  `English` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  `Slovene` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  `German` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  `Croatian` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  `Serbian` varchar(200) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`code`(80))
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

